import './App.css';
import Header from './Header';
import { BrowserRouter as Router, Route, Routes, Navigate, Link} from 'react-router-dom';
import React from 'react';


import Navigation from './Navigation';
import Home from './Home';

function App() {
  return (
    <div className="App" >
      <Router>
      <header className="header" style={{ 
      display: 'flex', 
      alignItems: 'right', 
     justifyContent: 'flex-start', 
      padding: '1px',
      marginLeft: '10px'
    }}>
      <img src="JSA Logo.png" alt="Japanese Student Association Logo" 
      style={{ 
        maxWidth: '100px', 
        maxHeight: '50px', 
        marginRight: '15px', 
        marginTop: '10px', 
        justifyContent: 'flex-start' 
    }} />
       <h1>Japanese Student Association</h1>
        </header>
        <nav className="navigation">

        <Link to="/Home" className="nav-item" style={{ marginRight: '1px' , marginBottom: '10px'}}>Home</Link>
        <Link to="/Social" className="nav-item" style={{ marginLeft: '20px' }}> Social</Link>
        <Link to="/Officers" className="nav-item" style={{ marginRight: '1px' , marginTop: '1px'}}>Officers</Link>
        <Link to="/Contact" className="nav-item" style={{ marginRight: '1px' , marginTop: '1px'}}>Contact</Link>
        </nav>





        </Router>
    </div>
  );
}

export default App;
